ser = serial.Serial('COM3', 256000, timeout=1 )

def makeImg(imgBts):
	d = bytes.fromhex(imgBts.upper())
	img = cv2.imdecode(np.frombuffer(d, np.uint8), -1)

	return img

def displayImg(img):
	cv2.imshow('Input', img)

	c = cv2.waitKey(1)

	time.sleep(2)

